import React from 'react';
import styled from 'styled-components';
import { FaReact, FaNodeJs, FaJsSquare, FaCss3Alt, FaHtml5, FaLinkedinIn, FaGithub } from "react-icons/fa";


const Header = () => {
  return (
    <Wrapper>
      <H1>
        Cheers, I'm Heather
      </H1>
      {/* <Links>
        <FaLinkedinIn />
        <FaGithub />
      </Links> */}
      <div>
        Full Stack Web Developer with a background in Digital Marketing.
      </div>
      <div>
        Craft Beer Enthusiast.
      </div>
      <Icons><FaReact size={50}/> <FaNodeJs size={50}/> <FaJsSquare size={50}/> <FaCss3Alt size={50}/> <FaHtml5 size={50}/></Icons>
    </Wrapper>
  )
}

const Wrapper = styled.div`
  height: 100vh;
  width: 100vw;
  background-color: teal;
  text-align: center;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  scroll-snap-type: y proximity
`;

const H1 = styled.h1`
  background-image: url(https://media.giphy.com/media/VIzmAi5KS3RyRhY9Sq/source.gif);
	background-size: center cover;
	color: transparent;
  -moz-background-clip: text;
	-webkit-background-clip: text;
  padding: 10px 20px;
  /* background-color: lightblue; */
  width: fit-content;
  font-size: 5rem;
  font-family: 'Righteous', cursive;
  text-transform: uppercase;
`;

const Icons = styled.div`
  position: absolute;
  bottom: 50px;
`;

export default Header
